            method: 'DELETE',
            headers: headerParameters,
            query: queryParameters,
            body: ObjectToJSON(requestParameters.object),
        }, initOverrides);

        return new runtime.JSONApiResponse(response, (jsonValue) => InformationFromJSON(jsonValue));
    }

    /**
     * Delete Object
     * Delete Object
     */
